const getNavigationItems = (role)=>{
    const baseItems = [
        {
            label: "Dashboard",
            href: `/${role}/dashboard`,
            icon: "IconDashboard"
        }
    ];
    switch(role){
        case "admin":
            return [
                ...baseItems,
                {
                    label: "Manajemen User",
                    href: "/admin/users",
                    icon: "IconUsers"
                },
                {
                    label: "Manajemen Keuangan",
                    href: "/admin/earnings",
                    icon: "IconCoin"
                }
            ];
        case "instructor":
            return [
                ...baseItems,
                {
                    label: "Kursus Saya",
                    href: "/instructor/courses",
                    icon: "IconBook"
                },
                {
                    label: "Forum Diskusi",
                    href: "/instructor/discussions",
                    icon: "IconMessageCircle"
                },
                {
                    label: "Penghasilan",
                    href: "/instructor/earnings",
                    icon: "IconCoin"
                }
            ];
        case "user":
            return [
                ...baseItems,
                {
                    label: "Kursus Saya",
                    href: "/user/courses",
                    icon: "IconBook"
                },
                {
                    label: "Jelajahi Kursus",
                    href: "/user/explore",
                    icon: "IconBookmark"
                },
                {
                    label: "Learning Path",
                    href: "/user/learning-paths",
                    icon: "IconPlaylist"
                },
                {
                    label: "Diskusi & Forum",
                    href: "/user/discussions",
                    icon: "IconMessageCircle"
                }
            ];
        default:
            return baseItems;
    }
};
